    public static int solve(int hp, int[] moves) {
        int count = 0;
        for (int i = 0; i < moves.length - 2; i++) {
            for (int j = i+1; j < moves.length - 1; j++) {
                for (int k = j+1; k < moves.length; k++) {
                    if (moves[i] + moves[j] + moves[k] == hp) count++;
                }
            }
        }
        return count;
    }
